const API_HOUSE = `http://localhost:8080/api/balanha/`

export const getOwnedHouseApi = () => {
    return fetch(
        `${API_HOUSE}getownedproperties`,
        {
            method: 'POST',
            body: JSON.stringify({
                category: house.type,
                city: house.city,
                district: house.district,
                ward: house.ward,
                detail: house.detail,
                description: house.description
            }),
            headers: {
                'Content-Type': 'application/json',
                'user_id': userId, 
                'token': token
            },
        }
    ).then((res) => {
        if (res.ok) {
            return res.json();
        } else {
            return res.json().then((data) => {
                let errorMessage = 'Authentication failed!';
                // if (data && data.error && data.error.message) {
                //   errorMessage = data.error.message;
                // }
    
                throw new Error(errorMessage);
            });
        }
    })
}

export const createHouseApi = (house, userId, token) => {
    return fetch(
        `${API_HOUSE}addhouse`,
        {
            method: 'POST',
            body: JSON.stringify({
                category: house.type,
                city: house.city,
                district: house.district,
                ward: house.ward,
                detail: house.detail,
                description: house.description
            }),
            headers: {
                'Content-Type': 'application/json',
                'user_id': userId, 
                'token': token
            },
        }
    ).then((res) => {
        if (res.ok) {
            return res.json();
        } else {
            return res.json().then((data) => {
                let errorMessage = 'Authentication failed!';
                // if (data && data.error && data.error.message) {
                //   errorMessage = data.error.message;
                // }
    
                throw new Error(errorMessage);
            });
        }
    })
}
